// @ts-nocheck
"use client";
import Button from "@/components/ui/button/button";
import Heading from "@/components/ui/heading";
import Input from "@/components/ui/input/input";
import MaterialSelect from "@/components/ui/input/materialSelect";
import Select from "@/components/ui/input/select";
import { createPersonalCarpet, generateCarpet } from "@/lib/api/carpet.api";

import {
  colors,
  materials,
  patterns,
  shapes,
  sizes,
  styles,
} from "@/lib/consts/carpets.consts";
import { useInput } from "@/lib/hooks/useInput";
import { required } from "@/lib/validation/validators";
import { Loader, Loader2 } from "lucide-react";
import { redirect } from "next/dist/server/api-utils";
import Image from "next/image";
import Link from "next/link";
import { useRouter } from "next/navigation";
import React, { useEffect, useState } from "react";

const Ai = () => {
  const router = useRouter();

  const prompt = useInput("");
  const [sizeGen, setSize] = useState({ width: 1024, height: 1024 });
  const [image, setImage] = useState("");
  const [loading, setLoading] = useState(false);

  const description = useInput("", [required]);

  const style = useInput("", [required]);
  const material = useInput("", [required]);
  const pattern = useInput("", [required]);
  const size = useInput("", [required]);
  const color = useInput("", [required]);
  const shape = useInput("", [required]);

  const handleGen = () => {
    setLoading(true);
    setImage(
      ""
    );

    console.log(
      `Дизайн ковра ${prompt.value} в 2D проекции на весь экран в стиле ${style.value} с узором ${pattern.value}, цвет: ${color.value}, форма: ${shape.value}`
    );

    generateCarpet({
      prompt: `Дизайн ковра ${prompt.value} в 2D проекции на весь экран в стиле ${style.value} с узором ${pattern.value}, цвет: ${color.value}, форма: ${shape.value}`,
      width: sizeGen.width,
      heigth: sizeGen.height,
    })
      .then((data) => setImage(data.image[0]))
      .catch((e) => console.log(e))
      .finally(() => setLoading(false));
  };

  const handleOrder = () => {
    createPersonalCarpet({
      title: "ai custom",
      description: prompt.value,
      price: 15000,
      img: image,
      style: style.value,
      material: material.value,
      pattern: pattern.value,
      size: size.value,
      color: color.value,
      shape: shape.value,
    }).then((e) => {
      console.log(e);
      router.push(`/order/create?order=${e.id}`);
    });
  };

  return (
    <main>
      <Heading>Генерация дизайна</Heading>
      <div className="mt-[60rem] mx-[165rem] flex justify-between">
        <div className="w-[640rem] h-[640rem] rounded-[10rem] border_accent_3 flex justify-center items-center">
          {!loading ? (
            !image ? (
              <span>Тут будет ваша генерация</span>
            ) : (
              <Image
                width={640}
                height={640}
                src={`data:image/png;base64,${image}`}
                alt=""
              />
            )
          ) : (
            <span className="flex gap-[8rem] items-center">
              Генерация <Loader className="animate-spin" />
            </span>
          )}
        </div>
        <div className="w-[380rem] flex flex-col gap-[12rem]">
          <label>
            <div className="mb-[12rem]">Описание</div>
            <textarea
              placeholder="Опишите ковер, котрый хотели бы получить"
              className="w-full input"
              value={prompt.value}
              onChange={prompt.onChange}
              onBlur={() => prompt.setDirty(true)}
            />
          </label>

          <label className="w-full">
            {style.error && <span className="text_warn">{style.error}</span>}
            <Select
              label="Стиль"
              defaultTitle="стиль ковра"
              value={style.value}
              onChange={style.onChange}
              onBlur={() => style.setDirty(true)}
              selectableValues={styles}
            />
          </label>
          <label className="w-full">
            {material.error && (
              <span className="text_warn">{material.error}</span>
            )}
            <Select
              label="Материал"
              defaultTitle="материал ковра"
              value={material.value}
              onChange={material.onChange}
              onBlur={() => material.setDirty(true)}
              selectableValues={materials}
            />
          </label>

          <label className="w-full">
            {pattern.error && (
              <span className="text_warn">{pattern.error}</span>
            )}
            <Select
              label="Узор"
              defaultTitle="узор ковра"
              value={pattern.value}
              onChange={pattern.onChange}
              onBlur={() => pattern.setDirty(true)}
              selectableValues={patterns}
            />
          </label>
          <label className="w-full">
            {size.error && <span className="text_warn">{size.error}</span>}
            <Select
              label="Размер"
              defaultTitle="размер ковра"
              value={size.value}
              onChange={size.onChange}
              onBlur={() => size.setDirty(true)}
              selectableValues={sizes}
            />
          </label>

          <label className="w-full">
            {color.error && <span className="text_warn">{color.error}</span>}
            <Select
              label="Цвет"
              defaultTitle="цвет ковра"
              value={color.value}
              onChange={color.onChange}
              onBlur={() => color.setDirty(true)}
              selectableValues={colors}
            />
          </label>
          <label className="w-full">
            {shape.error && <span className="text_warn">{shape.error}</span>}
            <Select
              label="Форма"
              defaultTitle="форму ковра"
              value={shape.value}
              onChange={shape.onChange}
              onBlur={() => shape.setDirty(true)}
              selectableValues={shapes}
            />
          </label>

          <Button
            onClick={handleGen}
            disabled={loading || !prompt.value}
            className="flex gap-[4rem] mt-[40rem] py-[18rem] btn_primary"
          >
            {loading && <Loader2 className="animate-spin mr-2" />}
            Сгенерировать
          </Button>
          <Button
            onClick={handleOrder}
            disabled={!image || loading}
            className="mt-[20rem] py-[18rem] btn_warn"
          >
            Оформить заказ
          </Button>
          {/*<div className="mt-[8rem] text-neutral-400">
            Ковры, созданные нейросетью, используются как пример и проходят
            доработку нашим дизайнером{" "}
          </div>*/}

          <div
            style={{ borderColor: "#63AA73" }}
            className="border_top pt-[32rem] pb-[100rem] mt-[32rem] flex flex-col"
          >
            <div className="text-[24rem]">
              <div className="mb-[8rem]">
                Не получилось сгенерировать подходящий дизайн?
              </div>
              <div>
                Оставьте заявку и мы сделаем индивидуальный дизайн для вас!
              </div>
              <Link
                className="w-full mt-[16rem] py-[18rem] btn btn_primary"
                href={"/custom"}
              >
                Оставить заявку
              </Link>
            </div>
          </div>
        </div>
      </div>
    </main>
  );
};

export default Ai;
